import React, { Component } from "react";

class Footer extends Component {
  render() {
    return (
      <div classname="footer">
        <div classname="img">
          <img src="../img/cat.png" />
        </div>
        <div classname="coppy">
          <h3>Coppy Right 2019+</h3>
        </div>
      </div>
    );
  }
}

export default Footer;
